export default function Navbar({ setPage }) {
  return (
    <nav className="navbar">
      <h2>Labour & Contractor</h2>
      <div>
        <button onClick={() => setPage("login")}>Login</button>
        <button onClick={() => setPage("register")}>Register</button>
      </div>
    </nav>
  );
}
